import React from 'react'
import './NavBar.css';


const NavBar = (props) => {
    return (
        <header>
            <nav className="NavBar">
                <h1 className="NavBarItem">LOGO</h1>
                <ul>
                    <li><a>Hi</a></li>
                </ul>
            </nav>
        </header>
    )
}

export default NavBar
